import React from 'react'

function TopButtons(setQuery) {
    const cities = [
        {
            id: 1,
            title: 'London'
        },
        {
            id: 2,
            title: 'Tokyo'
        },
        {
            id: 3,
            title: 'Los Angeles'
        },
        {
            id: 4,
            title: 'Toronto'
        },
        {
            id: 5,
            title: 'Hong Kong'
        },
    ]   
  return (
    <div className="flex items-center justify-around my-6">
        {cities.map((city => (
            <button key={city.id} className="text-white text-log font-medium ">{city.title}</button>
        )))}
    </div>
  )
}

export default TopButtons
